// QR Reader
import React from 'react';
import QRScanner from './QRScanner';

const App = () => {
  return (
    <div>
      <header>
        <h1>QR Code Scanner App</h1>
      </header>
      <main>
        <QRScanner />
      </main>
      <footer>
        <p>&copy; 2024 QR Scanner App</p>
      </footer>
    </div>
  );
};

export default App;
